  @override
  String get privacyPolicyContent =>
      'La présente politique de confidentialité explique comment ImmoSync KLG (\"ImmoSync\", \"nous\") traite les données personnelles lorsque vous utilisez notre site Web, nos applications et services (les \"Services\").\n\nImmoSync KLG, Hauptstrasse 38, 4411 Seltisberg, Bâle-Campagne, Suisse · Tél. : +41 76 391 94 00 · E‑mail : info@immosync.ch\n\nTable des matières\n1. Responsable du traitement\n2. Données que nous traitons\n3. Finalités et bases légales\n4. Cookies et traçage\n5. Analyses et fournisseurs tiers\n6. Partage des données\n7. Transferts internationaux\n8. Conservation\n9. Sécurité des données\n10. Mineurs\n11. Vos droits\n12. Exercice de vos droits\n13. Modifications de la présente politique\n14. Contact\n1. Responsable du traitement\nImmoSync KLG est responsable du traitement lié aux Services. Pour certaines fonctions (p. ex. paiements via Stripe ou notifications push), des fournisseurs externes agissent comme responsables indépendants ou sous-traitants.\n\n2. Données que nous traitons\nSelon votre utilisation des Services nous traitons notamment :\n\nDonnées de compte et de profil (nom, e‑mail, téléphone, adresse, rôles)\nDonnées d’authentification (hachages de mot de passe, jetons)\nDonnées d’usage et journaux (adresse IP, infos appareil/navigateur, actions, horodatages)\nContenus que vous fournissez (messages, tickets, documents, médias)\nDonnées de paiement (via Stripe ; nous ne stockons pas les numéros de carte complets)\nDonnées appareil/app pour fonctions mobiles (notifications, contacts – uniquement avec votre consentement)\nDonnées de communication (demandes au support, retours)\n\n3. Finalités et bases légales (RGPD / nLPD Suisse)\nFourniture et exploitation des Services ; exécution du contrat (art. 6(1)(b) RGPD)\nAmélioration de la sécurité, stabilité, performances ; défense de droits (intérêt légitime, art. 6(1)(f))\nCommunication avec vous (contrat, intérêt légitime ou consentement)\nFacturation et obligations légales (art. 6(1)(c))\nFonctionnalités optionnelles avec consentement (art. 6(1)(a) ; révocable à tout moment)\n\n4. Cookies et traçage\nNous utilisons des cookies nécessaires pour les fonctions de base et, le cas échéant, des cookies d’analyse afin de comprendre l’utilisation. Vous pouvez gérer les cookies via les paramètres du navigateur. La désactivation des cookies non essentiels peut limiter certaines fonctions.\n\n5. Analyses et fournisseurs tiers\nFournisseurs de confiance pour hébergement, analyses, paiements, messagerie, supervision des erreurs – traitement limité au nécessaire et conforme aux lois applicables.\nExemples : Hébergement (Vercel/AWS), Paiements (Stripe), Analyses (outils respectueux de la vie privée ou – lorsque permis – Google Analytics).\n\n6. Partage des données\nPartage avec sous-traitants et partenaires lorsque nécessaire pour fournir les Services, remplir des obligations légales ou dans le cadre d’opérations corporatives. Aucune vente de données personnelles.\n\n7. Transferts internationaux\nEn cas de transfert vers un pays sans niveau de protection adéquat : garanties appropriées (clauses contractuelles types + annexes suisses).\n\n8. Conservation\nDurée limitée au nécessaire ou aux exigences légales ; ensuite suppression ou anonymisation (ou conservation sécurisée jusqu’à suppression possible, ex. sauvegardes).\n\n9. Sécurité des données\nMesures techniques et organisationnelles adaptées (chiffrement, contrôles d’accès, monitoring). Aucun système n’est 100 % sûr ; usage à vos risques.\n\n10. Mineurs\nServices non destinés aux moins de 18 ans. Pas de collecte volontaire. Contactez-nous pour suppression si nécessaire.\n\n11. Vos droits\nAccès, rectification, effacement, limitation, portabilité, opposition ; plainte possible auprès d’une autorité de contrôle (PFPDT Suisse ; autorité UE ; ICO RU).\n\n12. Exercice de vos droits\nContact : info@immosync.ch ou formulaire sur immosync.ch/contact. Traitement des demandes conformément au droit applicable.\n\n13. Modifications de la présente politique\nMises à jour si évolution des traitements ou exigences légales. La date \"Dernière mise à jour\" indique la version actuelle.\n\n14. Contact\n\nImmoSync KLG\n\nHauptstrasse 38\n\n4411 Seltisberg (Bâle-Campagne)\n\nSuisse\n\nTél. : +41 76 391 94 00\n\nE‑mail : info@immosync.ch';

