révisées.\n\n1. Nos Services\nImmoSync fournit une plateforme numérique favorisant la communication et la collaboration entre propriétaires, locataires, prestataires de services et autres parties prenantes. La plateforme évolue continuellement et peut inclure : messagerie, tickets, gestion documentaire, planification, intégrations, automatisations ou réservations.\n\nLes informations fournies ne sont pas destinées aux utilisateurs situés dans des juridictions où l\'accès ou l\'utilisation serait contraire au droit applicable. Les utilisateurs hors de Suisse sont seuls responsables du respect des lois locales.\n\n2. Droits de propriété intellectuelle\nL\'ensemble des contenus, marques, designs, logiciels et bases de données des Services sont la propriété d\'ImmoSync KLG ou exploités sous licence et protégés par les lois sur la propriété intellectuelle.\n\nNous vous concédons une licence non exclusive, révocable et non transférable pour utiliser les Services à des fins internes. Toute reproduction, modification, publication ou exploitation au-delà du cadre contractuel nécessite notre accord écrit préalable.\n\n3. Déclarations de l\'utilisateur\nVous garantissez que les informations fournies sont exactes, à jour et complètes et seront mises à jour en cas de changement. Vous vous engagez à utiliser les Services conformément au droit et à ne pas porter atteinte aux droits de tiers.\n\nL\'accès via des outils automatisés ou bots est interdit. Nous pouvons suspendre ou supprimer des comptes en cas de violation.\n\n4. Inscription de l\'utilisateur\nCertaines fonctionnalités nécessitent une inscription. Les identifiants doivent rester confidentiels. Vous êtes responsable de toutes les activités effectuées via votre compte. Nous pouvons refuser ou modifier des identifiants contraires aux droits de tiers ou trompeurs.\n\n5. Achats et paiements\nLes paiements doivent être effectués en francs suisses (CHF) aux tarifs affichés. Les méthodes acceptées sont indiquées lors du processus. Taxes et prélèvements sont calculés selon la loi.\n\nVous autorisez le débit des montants dus via la méthode choisie et maintenez vos informations à jour. Nous pouvons examiner, limiter ou refuser des commandes.\n\n6. Abonnements\nLes abonnements se renouvellent automatiquement sauf résiliation en temps utile. La résiliation via le compte prend effet à la fin de la période de facturation en cours.\n\nLes périodes d\'essai peuvent être modifiées ou arrêtées. À leur terme, l\'abonnement devient payant sauf résiliation préalable.\n\n7. Logiciel\nNous pouvons fournir des logiciels ou applications. Des conditions supplémentaires (EULA) peuvent prévaloir. Vous ne pouvez pas décompiler, rétro‑concevoir ou redistribuer sans autorisation.\n\n8. Activités interdites\nInterdiction d\'utiliser les Services à des fins illégales, frauduleuses ou harcelantes, notamment :\nCollecte ou extraction de données sans autorisation\nPublication de contenus illicites, diffamatoires ou discriminatoires\nContournement de mesures de sécurité ou diffusion de logiciels malveillants\nAbus des canaux de support, faux signalements, usurpation d\'identité.\nNous pouvons agir (suppression, suspension, mesures juridiques).\n\n9. Contenu généré par les utilisateurs\nVous pouvez téléverser du contenu (textes, images, documents). Vous êtes responsable du respect des lois et droits de tiers.\n\n10. Licence sur les contributions\nEn fournissant du contenu vous nous accordez une licence mondiale, gratuite, transférable et perpétuelle pour exploiter, stocker, copier, adapter et publier ce contenu afin d\'opérer les Services. Vous conservez la propriété.\n\n11. Directives relatives aux avis\nLes avis doivent refléter des expériences réelles, rester factuels, sans propos offensants ou discriminatoires. Nous pouvons retirer les avis non conformes.\n\n12. Application mobile\nLicence limitée, révocable pour installation et usage sur vos appareils. Interdiction de modifier ou redistribuer. Les boutiques d\'applications sont tierces et non responsables du support.\n\n13. Sites et contenus tiers\nLiens possibles vers des contenus tiers. Nous déclinons toute responsabilité quant à leur exactitude, disponibilité ou pratiques de confidentialité. Usage à vos risques.\n\n14. Gestion des Services\nNous pouvons surveiller, restreindre l\'accès, supprimer des données ou ajuster techniquement pour assurer la sécurité et le bon fonctionnement. Pas d\'obligation de surveillance exhaustive.\n\n15. Protection des données\nVoir notre Politique de Confidentialité (intégrée aux présentes) pour le traitement des données personnelles.\n\n16. Violations de droits d\'auteur\nSignalez toute atteinte alléguée avec informations suffisantes. Les notifications abusives peuvent entraîner des conséquences juridiques.\n\n17. Durée et résiliation\nApplicables tant que vous utilisez les Services. Nous pouvons suspendre ou résilier en cas de violation. Vous pouvez résilier à tout moment; les obligations financières échues demeurent.\n\n18. Modifications et interruptions\nNous pouvons adapter, étendre ou cesser des parties des Services. Des maintenances peuvent causer des interruptions temporaires. Absence de responsabilité pour indisponibilités inévitables.\n\n19. Droit applicable\nDroit suisse (hors règles de conflit de lois et Convention de Vienne). Dispositions impératives de protection du consommateur conservées. For : Bâle-Campagne.\n\n20. Règlement des litiges\nPriorité à une résolution amiable. À défaut : arbitrage selon les règles de la Cour Européenne d\'Arbitrage (siège Strasbourg), arbitre unique, lieu : Bâle-Ville, langue : allemand. Droits légaux des consommateurs préservés.\n\n21. Corrections\nNous pouvons corriger erreurs ou inexactitudes et mettre à jour le contenu.\n\n22. Clause de non-responsabilité\nServices fournis \"en l\'état\" et \"selon disponibilité\"; aucune garantie d\'aptitude particulière dans les limites légales. Utilisation à vos risques.\n\n23. Limitation de responsabilité\nResponsabilité uniquement en cas de dol ou faute grave et pour atteinte à la vie, au corps ou à la santé. Faute légère : seulement obligations essentielles, limitée aux dommages prévisibles typiques. Responsabilités légales impératives préservées.\n\n24. Indemnisation\nVous garantissez ImmoSync contre toute réclamation de tiers liée à votre utilisation, vos contenus ou violations, y compris frais raisonnables de défense.\n\n25. Données utilisateur\nVous êtes responsable de la sauvegarde. Sauvegardes régulières effectuées sans garantie absolue contre la perte sauf faute grave de notre part.\n\n26. Communications électroniques\nEmails, messages in‑app ou formulaires valent notification écrite. Consentement aux communications électroniques (renonciation au papier dans la mesure légale).\n\n27. Notifications SMS\nMessages techniques (ex. 2FA). Tarifs standard opérateur possibles. Désactivation peut limiter sécurité/fonctionnalités.\n\n28. Dispositions finales\nAccord complet. Nullité partielle sans effet sur le reste. Cession soumise à consentement. Tolérance ponctuelle ≠ renonciation future.\n\n29. Contact\nImmoSync KLG\nHauptstrasse 38\n4411 Seltisberg (Bâle-Campagne)\nSuisse\nTél. : +41 76 391 94 00\nE-mail : info@immosync.ch';

